/**
 * Insert the method's description here.
 * Creation date: (6/8/2001 10:09:00 AM)
 * @param routeId java.lang.Integer
 */
public void setRoute(Integer routeId)
{
	IDatabaseCache cache =
		com.cannontech.database.cache.DefaultDatabaseCache.getInstance();
	synchronized (cache)
{
		java.util.List allRoutes = cache.getAllRoutes();
		for (int i = 0; i < allRoutes.size(); i++)
		{
			if (((com.cannontech.database.data.lite.LiteYukonPAObject) allRoutes.get(i)).getYukonId() == routeId.intValue())
				getRouteComboBox().setSelectedIndex(i);
		}
	}

}
/**
 * This method was created in VisualAge.
 * @param val java.lang.Object
 */
public void setValue(Object val) {
	if( getRouteComboBox().getModel().getSize() > 0 )
		getRouteComboBox().removeAllItems();

	IDatabaseCache cache = com.cannontech.database.cache.DefaultDatabaseCache.getInstance();
	synchronized(cache)
	{
		java.util.List allRoutes = cache.getAllRoutes();
		for(int i=0;i<allRoutes.size();i++)
			getRouteComboBox().addItem(allRoutes.get(i));
	}
}

